import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './style.css';

window.process = require('process/browser'); // ✅ Moved below imports to avoid ESLint warning

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
